INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(1, 'Бедный Ильвес! Оказывается, он провел целых десять лет на нежеланной должности президента со \"скудной\" зарплатой', 'Не секрет, что Тоомас Хендрик Ильвес не особо рвался в президенты Эстонии из-за \"скудной\" зарплаты и отсутствия практической полноты власти. Но теперь выяснилось, что и на второй срок Ильвес пошел нехотя.\r\n\r\n8 лет назад мир потрясла утечка документов от Wikileaks, которая касалась и эстонских политических деятелей. Как выяснилось из документов, для вступившего в должность президента Эстонии в 2006 году Тоомаса Хендрика Ильвеса \"небольшая\" зарплата главы государства и сравнительно незначительная политическая роль были совсем не притягательной комбинацией.\r\n\r\nВ обнародованных в 2011 году файлах посольства США зафиксированы слова Ильвеса послу США в 2006 году, когда он впервые избирался в президенты Эстонии: \"Думаю, вы хотите знать, почему я хочу эту должность. Ну, я ее и не хочу\". Также выяснилось, что участвовать в президентской гонки Ильвеса побудило презрение к президенту Арнольду Рюйтелю.', , 1, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(2, 'Министр: сдать тест на коронавирус смогут и те, кто не входит в группу риска', 'Министр социальных дел Эстонии Танель Кийк пообещал во вторник вечером в программе \"Aktuaalne kaamera\", что вскоре проверить себя на коронавирус смогут и люди с легкими симптомами заболевания.\r\n\r\n\r\n\"В сотрудничестве с частным сектором, Департаментом здоровья и чиновниками министерства мы пришли к решению, которое позволит в будущем по направлению семейного врача проверить себя и тем людям, у которых легкие симптомы и которые не находятся в группе риска, но у кого есть обоснованное подозрение на болезнь, подтвержденное также семейным врачом\".\r\n\r\n\"Вопрос в том, что, с одной стороны, Всемирная организация здравоохранения (ВОЗ) говорит, что чем больше тестов, тем лучше картина, но с другой стороны нужно найти режим оптимального использования медицинских ресурсов (...), и поэтому мы в сотрудничестве с частным сектором пришли к решению, которое отвечает рекомендациям ВОЗ и в том же время ожиданиям общественности по увеличению числа тестов\".', , 1, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(3, 'Благодаря заранее полученной информации российские правоохранители сумели предотвратить попытку пронести из Нарвы в Ивангород партии дорогостоящего наркотика.', 'TAЛЛИНН, 8 дек — Sputnik. В ходе проведения таможенного досмотра на пункте пропуска \"Ивангород - Нарва\" был задержан пытавшийся пронести наркотики 38-летний гражданин РФ, постоянно проживающий в эстонском городе Кохтла-Ярве.\r\n\r\nЗадержание полицейскими подозреваемого\r\n© SPUTNIK / АЛЕКСЕЙ СУХОРУКОВ\r\nПолиция ликвидировала крупнейшую нарколабораторию в России — подробности\r\nСумка с лаптопом перешедшего из Эстонии в Россию по пешеходному мосту \"Дружба\" мужчины оказалась \"заряженной\" четырьмя пакетами с белым порошком общей массой 975 грамм, привязанных к гаджету скотчем. Результаты проведенной экспертизы показали, что это премиальная наркотическая смесь на основе кокаина\r\nЗадержание наркокурьера произошло благодаря заранее полученной по каналам Главного управления по контролю за оборотом наркотиков МВД России информации. К операции, по сообщению портала 47news, были привлечены сотрудники Службы экономической безопасности ФСБ России, оперативники отдела по контролю оборота наркотиков полицейского Главка и Управления по борьбе с контрабандой Федеральной таможенной службы России.\r\n\r\nПо факту задержания было возбуждено уголовное дело по части третье статьи 229.1 УК РФ (контрабанда наркотических средств в крупном размере). В ближайшее время задержанному изберут меру пресечения.\r\n\r\nСогласно данным организации Global Drug Survey, в среднем по Европейскому союзу цена за 1 грамм кокаина колеблется в пределах от 75 до 100 евро. Таким образом, стоимость заряженного килограммом кокаина лаптопа на черном рынке могла составить ориентировочно 100 000 евро.', , 3, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(4, 'В Эстонии задержаны несовершеннолетние наркодилеры', 'ТАЛЛИНН, 17 дек — Sputnik. Полиция провела масштабные операции в шести городах Северо-Восточной Эстонии, по результатам которых задержаны 12 наркодилеров.\r\n\r\nОб этом сообщил ERR со ссылкой на руководителя криминального бюро Идаской префектуры Райнета Юузе. Отмечается, что среди наркоторговцев двое являются несовершеннолетними лицами, которые занимались перепродажей запрещенного вещества.\r\n\r\nПоселок надежды\r\n© SPUTNIK / ВАДИМ АНЦУПОВ\r\nС верой на надежду: как в Эстонии вернули к жизни сотни наркозависимых\r\nРейды прошли в начале декабря в Нарве, Силламяэ, Йыхви, Кохтла-Ярве, Раквере и Тапа, но известно о них стало лишь теперь. Также были задержаны для выяснения личности 17 человек, которые собирались приобрести наркотические вещества. 13 из них, в том числе двое несовершеннолетних, находились в состоянии наркотического опьянения.\r\n\r\nВ ходе рейда были изъяты марихуана, гашиш, кокаин и фентанил, а также 5500 евро, полученных преступных путем. Вируский уездный суд удовлетворил ходатайство прокуратуры и взял двух из наркоторговцев под стражу. Оба подозреваемых задержаны в Кохтла-Ярве, у них были обнаружены до 1000 микропакетиков с зеленым веществом растительного происхождения, предположительно, марихуаной.', , 3, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(5, 'В Таиланде слоны в шапочках Санта-Клауса раздали рождественские подарки', 'На на улицах тайских городов уже начали раздавать рождественские подарки, причем делают это слоны, передает «МИР 24».\r\n\r\nЖивотных нарядили в шапочки Санта-Клауса. Необычная процессия прибыла во двор местной школы. Каждый из учеников получил подарки – конфеты и игрушки. Акция уже традиционная, она проходит последние 15 лет. В финале все ее участники сели на площади в форме большой елки.\r\n\r\nРанее сообщалось, что в английской деревне Кегворт (графство Лестершир) появился тайный Санта-Клаус. Жители начали находить упакованные рождественские подарки на крыльце своих домов или недалеко от жилища. Тайный отправитель оставляет сладкие подарки, открытки и записки с надписью «Секретный Санта-Кегворт». ', , 2, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(6, 'Кладоискатели нашли рекордный клад древних монет', 'Древние монеты, найденные на британском острове Джерси, признаны самым большим кладом в истории Великобритании. Рекорд занесен в Книгу рекордов Гиннесса, сообщает издание Daily Mail. \r\n\r\nВ начале 1980-х жительница Джерси рассказала кладоискателям Регу Миду (Reg Mead) и Ричарду Майлзу (Richard Miles) о серебряной пуговице, которую она заметила в поле. Те поняли, что находка может указывать на спрятанные под землей сокровища, и 30 лет прочесывали остров с мощными металлоискателями. \r\n\r\nВ 2012 году кладоискатели обнаружили тайник под живой изгородью на фермерском поле. На глубине около метра оказались закопаны тысячи древнеримских и кельтских монет. Мид и Майлз предполагали, что их спрятали куриозолиты перед наступлением войск Юлия Цезаря.\r\n\r\n \r\n\r\nВ ходе раскопок из тайника извлекли 69347 древних монет. Первоначально их стоимость оценивалась в 10 миллионов фунтов стерлингов (843 миллиона рублей), пишет BBC News. Мид утверждает, что даже самые дешевые из найденных монет стоят не меньше 100 фунтов стерлингов (8,4 тысячи рублей). \r\n\r\nПо британскому закону о кладах 1996 года, находку объявили собственностью королевы. Кладоискатели могут рассчитывать лишь на вознаграждение, но не на долю сокровищ. \r\n\r\nПрежде считалось, что самый большой клад монет в Великобритании был найден в 1978 году в Уилтшире. Он состоял из 54951 медной монеты, отчеканенной в третьем веке до нашей эры. Крупнейший клад монет в мире, насчитывающий 150 тысяч серебрянных монет XIII века, обнаружен в 1908 году в Брюсселе. \r\n\r\nКуриозолиты — одно из кельтских племен, покоренных Римом. Упоминаются в трудах Плиния Старшего и Юлия Цезаря.', , 2, 1);

